import React, { Component } from 'react'
import { Result, Button } from 'antd'
import MyNavLink from '../../../components/MyNavLink'

export default class Complete extends Component {

    state = {
        isSuccess: 0,
        data: []
    }

    componentDidMount() {
        const { isSuccess, data } = this.props.history.location.state
        this.setState({ isSuccess, data })
    }

    render() {
        const { isSuccess, data } = this.state
        return (
            <div>
                <Header className="head">订票系统
                    <span style={{ marginLeft: '800px', fontSize: '15px' }}>
                        {
                            !user ? <Link to="/user/login" style={{ marginLeft: '20px' }}>登录</Link> : <span>{user.phone}<LinkButton style={{ marginLeft: '20px' }}>退出</LinkButton></span>
                        }
                    </span>
                </Header>
                {
                    isSuccess === 1 ? <Result
                        status="success"
                        title="订票成功！"
                        subTitle={`订单编号: ${data.map((item) => {
                            return item
                        })}`}
                        extra={[
                            <MyNavLink to="/user/home/center">
                                <Button type="primary" key="console">
                                    个人中心
                                </Button>
                            </MyNavLink>
                            ,
                            <MyNavLink to="/user/search">
                                <Button key="buy">继续买票</Button>
                            </MyNavLink>,

                        ]}
                        style={{ marginTop: '100px' }}
                    />
                        :
                        <Result
                            status="success"
                            title="取消成功！"
                            subTitle={`订单编号: ${data.map((item) => {
                                return item
                            })}`}
                            extra={[
                                <MyNavLink to="/user/home/center">
                                    <Button type="primary" key="console">
                                        个人中心
                                    </Button>
                                </MyNavLink>
                                ,
                                <MyNavLink to="/user/search">
                                    <Button key="buy">继续买票</Button>
                                </MyNavLink>,

                            ]}
                            style={{ marginTop: '100px' }}
                        />
                }

            </div>
        )
    }
}
